	add("niggerfuxation", "{\"term\":\"niggerfuxation\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From \u0027\u0027 \u0027\u0027 \u0027\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Ruination by black people.\u0026lt;!--NOTE: the \u0026quot;unknown authors\u0026quot; below are because Google Groups appears to have removed the posts from its archive, though they are still searchable; this makes it impossible to find the author\u0027s name.--\u0026gt\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2002\u0027\u0027, (unknown author), \u0027SICKKKENING LIBERAL PUSSYBABBLE!\u0027 (on newsgroup \u0027atl.general\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"White people can afford to stand by NO LONGER, and watch our land succumb to \u0027\u0027niggerfuxation\u0027\u0027, city by city. We must secure the existence of our peopl\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, (unknown author), \u0027Ending hate in Israel\u0027 (on newsgroup \u0027alt.flame.niggers\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"These actions should correct the racial imbalance and begin the \u0027\u0027niggerfuxation\u0027\u0027 of joorael\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, \u0026quot;Raptorman\u0026quot;, \u0027French teacher \u0026quot;send\u0026quot;jewish student to furnace, oi !!!\u0027 (on newsgroup \u0027soc.culture.israel\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Look at your cities they have become cesspools of \u0027\u0027niggerfuxation\", \"priority\":7}]}, \"synonyms\":{}}");

	add("niggerhood", "{\"term\":\"niggerhood\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|nigger|hood|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or period of being a nigger\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, George E Kent, \u0027Blackness and the adventure of Western culture‎\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"But this time, black literature will be pressed to meet also the cry that is abroad for images of a positive \u0027\u0027niggerhood\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, Steve Yarbrough, \u0027Visible spirits‎\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He still believed that folks who held a fortune could rise above \u0027\u0027niggerhood\", \"priority\":5}]}, \"synonyms\":{}}");

	add("niggerism", "{\"term\":\"niggerism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|nigger|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Political support for black people\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, William Fletcher Thompson, \u0027The History of Wisconsin\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Their black support confirmed the charge of \u0026quot;\u0027\u0027niggerism\u0027\u0027\u0026quot; and helped the Democrats turn the widespread Negrophobia to their account\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1988\u0027\u0027, Philip M Seib, \u0027Who\u0027s in Charge\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The spot quoted a Klan official saying, \u0026quot;In Alabama, we hate \u0027\u0027niggerism\u0027\u0027, Catholicism, and Judaism.\u0026quot\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Something characteristic of niggers\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Claude McKay, \u0027Banjo\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"He loved their tricks of language, loved to pick up and feel and taste new words from their rich reservoir of \u0027\u0027niggerisms\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1975\u0027\u0027, Daniel J Leab, \u0027From Sambo to Superspade: the Black experience in motion pictures\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"But as it was, not until the 1940s did the industry begin to depart significantly from the stereotypes with their \u0026quot;insulting \u0027\u0027niggerisms\u0027\u0027\u0026quot\", \"priority\":10}]}, \"synonyms\":{}}");

