	add("nightmare", "{\"term\":\"nightmare\", \"etymology\":{\"influencers\":[], \"languages\":[\"German\", \"English\", \"middle english (1100-1500)\", \"middle low german\", \"Dutch\", \"scots\"], \"text\":\"From Middle english (1100-1500) {{m|enm|nightemare}}, {{m|enm|niȝtmare}}, equivalent to {{compound|night|mare|t2\u003devil spirit believed to afflict a sleeping person|lang\u003den}}. Cognate with Scots {{m|sco|nichtmare}}, {{m|sco|nichtmeer||nightmare}}, Dutch {{m|nl|nachtmerrie||nightmare}}, Middle low german {{m|gml|nachtmār||nightmare}}, German {{m|de|Nachtmahr||nightmare}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A female demon or monster, thought to plague people while they slept and cause a feeling of suffocation and terror during sleep\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1817\u0027\u0027, \u0027Rob Roy\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It haunted me, however, more than once, like the \u0027\u0027nightmare\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1843\u0027\u0027, ‘The Black Cat’\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I started, hourly, from dreams of unutterable fear, to find the hot breath of the thing upon my face, and its vast weight—an incarnate \u0027\u0027Night-Mare\u0027\u0027 that I had no power to shake off—incumbent eternally upon my heart\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A very bad or frightening dream\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"I had a \u0027\u0027nightmare\u0027\u0027 that I tried to run but could neither move nor breathe\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"July 18 2012\u0027\u0027, Scott Tobias, AV Club \u0027The Dark Knight Rises\u0027[http://www.avclub.com/articles/the-dark-knight-rises-review-batman,82624\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"With his crude potato-sack mask and fear-inducing toxins, The Scarecrow, a “psychopharmacologist” at an insane asylum, acts as a conjurer of \u0027\u0027nightmares\u0027\u0027, capable of turning his patients’ most terrifying anxieties against them\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Any bad, miserable, difficult or terrifying situation or experience that arouses anxiety, terror, agony or great displeasure\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Cleaning up after identity theft can be a \u0027\u0027nightmare\u0027\u0027 of phone calls and letters\", \"priority\":11}]}, \"synonyms\":{}}");

	add("nightshade", "{\"term\":\"nightshade\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Old English nihtscada, apparently corresponding to night + shade.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of the poisonous plants belonging to the genus \u0027Solanum\u0027, especially black nightshade or woody nightshade\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any plant of the wider Solanaceae family, including the nightshades as well as tomato, potato, eggplant, and deadly nightshade\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Belladonna or deadly nightshade, \u0027Atropa belladonna\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Any of several plants likened to nightshade, usually because of similar dark-colored berries\", \"priority\":4}]}, \"synonyms\":{}}");

